import React from "react";


function  onClick(ev,id) {
    alert("Clicked" + id);
}

const GameCircle = ({id, color, children}) => {
    //console.log("GameCircle", id, color);
    const style_ = {
        backgroundColor: color,
        width:100,
        height:100,
        borderRadius:"50%",
        margin: "10px",
    }
    return <div style={style_}  onClick={(ev)=>onClick(ev,id)}> 
        {children}
         </div>;
}

export default GameCircle;
